(98, 1, '2019-10-02 08:02:31', '2019-10-02 08:02:31', 'With its purple facade and small pavement terrace, it is hard to miss Le Babalou on the rue Lamarck, one of the main streets winding down from Sacre-Coeur. Le Babalou specialises in fine Italian cuisine, offering a great choice of authentic pizzas and fresh pasta dishes, all prepared with fresh, seasonal ingredients. Desserts are no less authentic, featuring some delicious favourite Italian sweet treats such as homemade tiramisu and panna cotta. Le Babalou’s interesting interior is reminiscent of a living room complete with patterned wallpaper, well-stocked bookshelves and a fine collection of lampshades, making this a great spot to feel immersed in the area.', 'Le Babalou', '', 'publish', 'open', 'closed', '', 'le-babalou', '', '', '2019-10-02 08:02:31', '2019-10-02 08:02:31', '', 0, 'https://wp-test.getgolo.com/?post_type=place&amp;p=98', 0, 'place', '', 0),
