(1923, 1, '2019-10-28 16:14:53', '2019-10-28 16:14:53', 'Known for its varied, multidisciplinary programme, which includes events ranging from literary festivals to queer club nights, Tolhuistuin stands on the northern banks of the river Ij, across the water from Amsterdam’s Centraal Station. The venue ranks among the largest cultural hubs in Amsterdam and collaborates with several other local initiatives in order to create inclusive, progressive events that often revolve around contemporary social or political issues. At its heart, the venue serves as an incubator for forward-thinking ideas and tends to focus on avant-garde art, music and literature. There’s also a spacious restaurant and bar with terrace located on-site, offering speculator views of Amsterdam’s southern docklands.', 'Tolhuistuin', '', 'publish', 'open', 'closed', '', 'tolhuistuin', '', '', '2019-10-28 16:14:53', '2019-10-28 16:14:53', '', 0, 'https://wp-test.getgolo.com/?post_type=place&amp;p=1923', 0, 'place', '', 0),
(2052, 1, '2019-10-30 09:06:27', '2019-10-30 09:06:27', 'The building lives up to the hype of this, perhaps the most celeb-beloved hotel in London—it’s a flouncy, fiery red-brick former fire station between trendy Marylebone High Street and Baker Street. The building lives up to the hype of this, perhaps the most celeb-beloved hotel in London—it’s a flouncy, fiery red-brick former fire station between trendy Marylebone High Street and Baker Street. The building lives up to the hype of this, perhaps the most celeb-beloved hotel in London—it’s a flouncy, fiery red-brick former fire station between trendy Marylebone High Street and Baker Street.', 'Chiltern Firehouse', '', 'publish', 'open', 'closed', '', 'chiltern-firehouse', '', '', '2019-10-30 09:06:27', '2019-10-30 09:06:27', '', 0, 'https://wp-test.getgolo.com/?post_type=place&amp;p=2052', 0, 'place', '', 0),
(2107, 1, '2019-10-30 10:16:54', '2019-10-30 10:16:54', 'COMO is located on a long, lovely, heavily landscaped driveway (shared with the Banyan Tree Hotel) off a very busy road. Tall surrounding walls and plenty of plant life help it feel like a retreat from the hustle of Sathorn, neighborhood with a lot to offer visitors and expats. Enjoy a meal at one of the hotel\'s dining establishments, which include 4 restaurants and a coffee shop/café. From your room, you can also access 24-hour room service. Relax with your favorite drink at a bar/lounge or a poolside bar. Breakfast is available for a fee.', 'Metropolitan', '', 'publish', 'open', 'closed', '', 'metropolitan-bangkok', '', '', '2019-10-30 10:16:54', '2019-10-30 10:16:54', '', 0, 'https://wp-test.getgolo.com/?post_type=place&amp;p=2107', 0, 'place', '', 0),
(2152, 1, '2019-11-01 03:36:14', '2019-11-01 03:36:14', '<!-- wp:paragraph -->\n<p>Lots of sex. Lots of swimming. Dating apps. Boarding school vibes from the ’90s. A mystical jungle. A group of outcast artists. A group of outcast scientists. Longing, desire, obsession. Lying. Telling the truth. A goldfish that watches cartoons in slippers. Eight Mennonite women who imagined something beyond the only world they’d ever known. Meet our ten favorite new books—novels, short stories, essay collections—each peculiar and alluring in its own way.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3><em>Very Nice</em>&nbsp;by&nbsp;Marcy&nbsp;Dermansky</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Smart, sexy, addictive. This book has Labor Day written all over it. It’s told through the perspective of several characters, including college-age Rachel Klein and her newly divorced mother, Becca, who are both attracted to the same man: acclaimed (broke) novelist and Rachel’s creative writing professor Zahid Azzam. Most of the characters in&nbsp;<em>Very Nice</em>&nbsp;have an inclination toward bad behavior, which is partly what makes it fun. And they bring together specific circles of Manhattan investment banking, Midwest MFA programs, and suburban Connecticut—poolside in the summer. As for the book’s ending…we really need more people to discuss it with. So: #goopbookclub.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3><em>The Expectations</em>&nbsp;by&nbsp;Alexander&nbsp;Tilney</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Set in the ’90s at a fictional boarding school called St. James (the author, Alex Tilney, went to St. Paul’s), this beautifully written coming-of-age novel is a subtle exploration of WASP culture and elite institutions: what it means to hail from them, the lengths we’ll go to to protect them, and what it means when they can’t keep up with the evolution of society.</p>\n<!-- /wp:paragraph -->', '10 Books for Labor Day 2019 (and Beyond)', '', 'publish', 'open', 'open', '', '10-books-for-labor-day-2019-and-beyond', '', '', '2019-11-01 03:36:14', '2019-11-01 03:36:14', '', 0, 'https://wp-test.getgolo.com/?p=2152', 0, 'post', '', 0),
(2195, 1, '2019-11-01 07:04:02', '2019-11-01 07:04:02', '<div id=\"property_description_content\">\r\n\r\nBoutique hotel The Dylan is set along the Keizersgracht canal, in the heart of Amsterdam. Dam Square is a short walk away. The on-site <span class=\"hp-social_proof-item-featured-topic jq_tooltip hp-social_proof-item-featured-topic-element\" data-component=\"tooltip\" data-tooltip-text=\"6 review highlights from guests\">restaurant Vinkeles</span> has a Michelin star.\r\n\r\nThe Dylan offers rooms and suites, some of them specially designed by Remy Meijers, a well-known Dutch designer. All have luxurious bathrooms, a bathrobe and slippers. There is free Wi-Fi.\r\n\r\nThe award-winning restaurant is located in an 18th century bakery with garden views. French cuisine is served complemented by wines from the cellar.\r\n\r\nThe Dylan has a fitness centre, a massage <span class=\"hp-social_proof-item-featured-topic jq_tooltip hp-social_proof-item-featured-topic-element\" data-tooltip-text=\"17 review highlights from guests\" data-component=\"tooltip\">service</span> and a garden with terrace. There is a lounge and <span class=\"hp-social_proof-item-featured-topic jq_tooltip hp-social_proof-item-featured-topic-element\" data-component=\"tooltip\" data-tooltip-text=\"16 review highlights from guests\">bar</span> to relax.\r\n\r\nThe Nine Streets shopping area can be found around the corner for guests who enjoy boutique shopping. All major sights are within <span class=\"hp-social_proof-item-featured-topic jq_tooltip hp-social_proof-item-featured-topic-element\" data-tooltip-text=\"3 review highlights from guests\" data-component=\"tooltip\">walking distance</span>. Trams, buses and metro stops are only minutes away.\r\n\r\n<span style=\"font-size: inherit;\">Amsterdam City Centre is a great choice for travellers interested in </span><span class=\"hp_district_endorsement_item\" style=\"font-size: inherit;\">nightlife</span><span style=\"font-size: inherit;\">, </span><span class=\"hp_district_endorsement_item\" style=\"font-size: inherit;\">architecture</span><span style=\"font-size: inherit;\"> and </span><span class=\"hp_district_endorsement_item\" style=\"font-size: inherit;\">walking</span><span style=\"font-size: inherit;\">.</span>\r\n\r\n</div>', 'The Dylan', '', 'publish', 'open', 'closed', '', 'the-dylan', '', '', '2019-11-01 07:04:02', '2019-11-01 07:04:02', '', 0, 'https://wp-test.getgolo.com/?post_type=place&amp;p=2195', 0, 'place', '', 0),
(2220, 1, '2020-07-10 07:34:08', '2020-07-10 07:34:08', 'San Francisco based Ramen Truck’s Brick&amp;Mortars Offering organic pork-chicken broth cooked to perfection within 15 hours. Chashu (Roasted pork shoulder) and Kakuni (Braise pork belly) available. Serving fried garlic, black garlic, and spiciness to your needs. Veggie ramen available with vegan miso broth with your 3 choices of veggies!’', 'Torraku Ramen', '', 'publish', 'open', 'closed', '', 'torraku-ramen', '', '', '2021-03-22 08:23:13', '2021-03-22 08:23:13', '', 0, 'https://wp-test.getgolo.com/?post_type=place&#038;p=2220', 0, 'place', '', 1),
(2227, 1, '2020-07-01 07:46:13', '2020-07-01 07:46:13', 'The western part of the Canal Ring is a labyrinthine neighborhood, known as De Negen Straatjes (the Nine Streets), filled with independent shops. The act of shopping becomes a full-on afternoon activity as you wander the brick sidewalks searching for the perfect quirky souvenir or gift. The western part of the Canal Ring is a labyrinthine neighborhood, known as De Negen Straatjes (the Nine Streets), filled with independent shops. The act of shopping becomes a full-on afternoon activity as you wander the brick sidewalks searching for the perfect quirky souvenir or gift.', 'The 9Streets', '', 'publish', 'open', 'closed', '', 'the-9-streets', '', '', '2020-07-01 07:46:13', '2020-07-01 07:46:13', '', 0, 'https://wp-test.getgolo.com/?post_type=place&amp;p=2227', 0, 'place', '', 0),
(2285, 1, '2019-11-01 08:53:02', '2019-11-01 08:53:02', 'Flor, in Borough Market, comes with serious credentials; after all, it\'s the long-awaited little sister to the Michelin-starred Lyle’s. Its ground-floor wine bar doubles as a bakery, already known for its sourdough; supplies are limited, so invest in a loaf on arrival. Stools—reserved for walk-ins—line the window and marble counter, which overlooks the kitchen (tiny is an understatement; even four chefs seems a squeeze). Up a spiral staircase, the dining room is surprisingly calm, with a double-height ceiling, bare brick walls, and petrol-blue banquettes.', 'Flor Coffee', '', 'publish', 'open', 'closed', '', 'flor', '', '', '2019-11-01 08:53:02', '2019-11-01 08:53:02', '', 0, 'https://wp-test.getgolo.com/?post_type=place&amp;p=2285', 0, 'place', '', 0),
