(4509, 1, '2020-06-25 16:25:02', '2020-06-25 16:25:02', 'North Park Massage is a therapeutic massage clinic that specializes in precision massage. Our state certified massage therapists produce tangible results by using methods based on the practical applications of anatomy &amp; physiology such as: Deep Tissue, Trigger Point, Sports, Swedish, Myofascial Release, Neuromuscular Therapy, Therapeutic Blends, and Prenatal massages in a professional + modern setting. There are no boring routines here - every massage is custom tailored for your body! Simply book a \'customized\' or \'medical\' massage and your massage therapist will conduct an intake interview to determine the most effective methods to elevate your wellbeing.', 'Therapy', '', 'publish', 'open', 'closed', '', 'therapy', '', '', '2020-06-25 16:25:02', '2020-06-25 16:25:02', '', 0, 'https://golotest.uxper.co/business-listing/place/north-park-massage/', 0, 'place', '', 0),
(4516, 1, '2020-06-25 16:30:57', '2020-06-25 16:30:57', 'Sevilla Nightclub is one of the most popular and longest running nightclubs in San Diego\'s Gaslamp Quarter. This stand-out nightlife destination delivers a unique atmosphere with the best in live entertainment including turn-table DJ\'s, live bands, dance instructors and more! The nightclub space offers an intimate ambiance including a roomy dance floor, plush lounge area, impressive sound/lighting system and VIP bottle service amenities. Early arrival, guest list and VIP Bottle Service is always recommended. We look forward to welcoming you and providing the best nightlife experience in the Gaslamp! Please visit our website for the most up-to-date event calendar.', 'Sevilla Restaurant', '', 'publish', 'open', 'closed', '', 'sevilla-nightclub', '', '', '2020-06-25 16:30:57', '2020-06-25 16:30:57', '', 0, 'https://golotest.uxper.co/business-listing/place/sevilla-nightclub/', 0, 'place', '', 0),
(4519, 1, '2020-06-25 16:35:45', '2020-06-25 16:35:45', 'Farid is an angel!! I went in on Memorial Day to check out my ac, it unfortunately started blowing hot air. He looked at it and accessed it was the ac compressor. His price was better than anyone else around! Had to come in on a Saturday to get the work done which was convenient. I came back a couple hours later and it turns out it wasn\'t the compressor at all, It was the AC pressure switch that malfunctioned. It was much cheaper than he had estimated!! He was honest with me and so happy to give me the good news!!! I will definitely be going back to him and I\'m referring my family to him as well. Thank you for your kindness and honesty!!!', 'Ushio Ramen', '', 'publish', 'open', 'closed', '', 'ushio-ramen', '', '', '2020-06-25 16:35:45', '2020-06-25 16:35:45', '', 0, 'https://golotest.uxper.co/business-listing/place/fair-auto-repair/', 0, 'place', '', 0),
