sites/7/2020/11/image-default.jpg\" alt=\"Vegatarian\">\n										</a>\n										<h3>\n											<a href=\"https://golotest.uxper.co/restaurant/?s=&#038;post_type=place&#038;category=vegatarian\">\n												Vegatarian												(3)											</a>\n										</h3>\n										<a href=\"https://golotest.uxper.co/restaurant/?s=&#038;post_type=place&#038;category=japn\">\n											<img src=\"https://golotest.uxper.co/restaurant/wp-content/uploads/sites/7/2020/11/image-default.jpg\" alt=\"Japan\">\n										</a>\n										<h3>\n											<a href=\"https://golotest.uxper.co/restaurant/?s=&#038;post_type=place&#038;category=japn\">\n												Japan												(1)											</a>\n										</h3>\n										<a href=\"https://golotest.uxper.co/restaurant/?s=&#038;post_type=place&#038;category=pizza\">\n											<img src=\"https://golotest.uxper.co/restaurant/wp-content/uploads/sites/7/2020/11/image-default.jpg\" alt=\"Pizza\">\n										</a>\n										<h3>\n											<a href=\"https://golotest.uxper.co/restaurant/?s=&#038;post_type=place&#038;category=pizza\">\n												Pizza												(2)											</a>\n										</h3>\n										<a href=\"https://golotest.uxper.co/restaurant/?s=&#038;post_type=place&#038;category=mexican\">\n											<img src=\"https://golotest.uxper.co/restaurant/wp-content/uploads/sites/7/2020/11/image-default.jpg\" alt=\"Mexican\">\n										</a>\n										<h3>\n											<a href=\"https://golotest.uxper.co/restaurant/?s=&#038;post_type=place&#038;category=mexican\">\n												Mexican												(1)											</a>\n										</h3>\n			<h3>Featured Cities</h3>		\n				<p>Explore restaurants &amp; cafes by locality</p>			\n					<a href=\"https://golotest.uxper.co/restaurant/city/chicago/\">\n						<img src=\"https://golotest.uxper.co/restaurant/wp-content/uploads/sites/7/2020/11/image-default-370x570.jpg\" alt=\"Chicago\">\n							<h3>Chicago</h3>\n														3 places\n					</a>\n					<a href=\"https://golotest.uxper.co/restaurant/city/los-angeles/\">\n						<img src=\"https://golotest.uxper.co/restaurant/wp-content/uploads/sites/7/2020/11/image-default-370x270.jpg\" alt=\"Los Angeles\">\n							<h3>Los Angeles</h3>\n														1 place\n					</a>\n					<a href=\"https://golotest.uxper.co/restaurant/city/new-york/\">\n						<img src=\"https://golotest.uxper.co/restaurant/wp-content/uploads/sites/7/2020/11/image-default-370x270.jpg\" alt=\"New York\">\n							<h3>New York</h3>\n														1 place\n					</a>\n					<a href=\"https://golotest.uxper.co/restaurant/city/sandiego/\">\n						<img src=\"https://golotest.uxper.co/restaurant/wp-content/uploads/sites/7/2020/11/image-default-370x270.jpg\" alt=\"San Diego\">\n							<h3>San Diego</h3>\n														5 places\n					</a>\n					<a href=\"https://golotest.uxper.co/restaurant/city/san-fancisco/\">\n						<img src=\"https://golotest.uxper.co/restaurant/wp-content/uploads/sites/7/2020/11/image-default-370x270.jpg\" alt=\"San Fancisco\">\n							<h3>San Fancisco</h3>\n														1 place\n					</a>\n			<h2>Restaurateurs Join Us</h2>		\n				<p>Join the more than 10,000 restaurants which fill seats and <br />manage reservations with Golo.</p>			\n			<a href=\"#\" role=\"button\">\n						Learn More\n					</a>\n			<h3>People Talking About Us</h3>		\n			<img  src=\"https://golotest.uxper.co/restaurant/wp-content/uploads/sites/7/2020/11/avatar-default.jpg\" alt=\"avatar-default\" />		\n					You easily falls into the Paris atmosphere, and will feel like a Parisian yourself. My wife and I have visited Paris several times, and we will be back again.				\n			<h4>Kevin kay</h4>Web Design		\n			<img  src=\"https://golotest.uxper.co/restaurant/wp-content/uploads/sites/7/2020/11/avatar-default.jpg\" alt=\"avatar-default\" />		\n					Two great streets to stroll down and view open markets of flowers, cheese, meats, chocolates and baguettes. Several cafes are there for lunch or dinner.				\n			<h4>Anna Kim</h4>Web Design		\n			<img  src=\"https://golotest.uxper.co/restaurant/wp-content/uploads/sites/7/2020/11/avatar-default.jpg\" alt=\"avatar-default\" />		\n					I stayed with my Mom and my 6 year old daughter for 9 nights the first week of July. I loved the location next to the RER station and having Luxembourg Gardens next store to our doorstep. 				\n			<h4>Cristina</h4>Web Design		\n			<h3>From Our Blog</h3>		\n			<a href=\"#\" role=\"button\">\n						View more\n					</a>', 'Home', '', 'inherit', 'closed', 'closed', '', '5073-revision-v1', '', '', '2020-11-12 07:49:40', '2020-11-12 07:49:40', '', 5073, 'http://localhost:8080/wordpress/?p=5134', 0, 'revision', '', 0),
